import React from 'react';

interface OtherFieldsProps {
  onSubmit: () => void;
}

const OtherFields: React.FC<OtherFieldsProps> = ({ onSubmit }) => {
  return (
    <div className="space-y-6 mt-6">
      <div>
        <label className="text-[#4F6C8D] mb-2 flex items-center text-sm">
          <span>Kdo se necítí dobře?</span>
          <span className="text-red-500 ml-0.5">*</span>
        </label>
        <input
          type="text"
          className="w-full p-3 border border-[#E5E9F2] rounded-xl focus:outline-none focus:ring-2 focus:ring-blue-500 text-sm"
          required
        />
      </div>

      <div>
        <label className="text-[#4F6C8D] mb-2 flex items-center text-sm">
          <span>Třída</span>
          <span className="text-red-500 ml-0.5">*</span>
        </label>
        <input
          type="text"
          className="w-full p-3 border border-[#E5E9F2] rounded-xl focus:outline-none focus:ring-2 focus:ring-blue-500 text-sm"
          required
        />
      </div>

      <div>
        <label className="text-[#4F6C8D] mb-2 flex items-center text-sm">
          <span>Více informací</span>
          <span className="text-gray-400 ml-2">(?)</span>
        </label>
        <textarea
          className="w-full p-3 border border-[#E5E9F2] rounded-xl focus:outline-none focus:ring-2 focus:ring-blue-500 text-sm min-h-[200px]"
          placeholder="Uveďte prosím co nejvíce podrobností..."
        />
      </div>

      <div className="text-sm text-[#4F6C8D]">
        Seznamte se s informacemi o tom,{' '}
        <a href="#" className="text-[#0095FF] hover:underline">
          jak zpracováváme osobní údaje
        </a>
        .
      </div>

      <button
        onClick={onSubmit}
        className="w-full p-3 rounded-xl text-white font-medium bg-[#0095FF] hover:bg-[#0077CC] transition-all duration-200"
      >
        Odeslat
      </button>
    </div>
  );
};

export default OtherFields;
